* { margin: 0; padding: 0; box-sizing: border-box; }
body { font-family: Arial, sans-serif; font-size: 14px; padding: 20px; }

.label { font-size: 12px; color: #666; margin: 10px 0 5px; }

.container {
  width: 400px;
  background: #f0f0f0;
  padding: 10px;
  margin-bottom: 30px;
  overflow: auto;
}

.float-left {
  float: left;
  width: 100px;
  height: 100px;
  background: #4a90d9;
  color: white;
  margin: 5px;
  display: flex;
  align-items: center;
  justify-content: center;
}

.float-right {
  float: right;
  width: 100px;
  height: 100px;
  background: #66bb6a;
  color: white;
  margin: 5px;
  display: flex;
  align-items: center;
  justify-content: center;
}
